var shipperAgreementTemplate = "<h1><strong><u>Shipper &amp; Carrier User Agreement</u></strong></h1><p><br></p><p>This Agreement Shipper and Carrier User Agreement (\"Agreement\") is entered into by and between [Shipper Name], a company organized and existing under the laws of [Jurisdiction], with its principal place of business at [Address] (\"Shipper\"), and [Carrier Name], a company organized and existing under the laws of [Jurisdiction], with its principal place of business at [Address] (\"Carrier\").</p><p><br></p><p><strong>Purpose</strong></p><p>This Agreement governs the terms and conditions under which Shipper and Carrier agree to engage in transportation services, including the shipment of goods, freight, or cargo (\"Cargo\"), as outlined herein.</p><h2><br></h2><h2>Terms and Condition</h2><ol><li>Carrier agrees to transport a series of interstate shipments for Shipper pursuant to carrier load confirmation sheet(s) included herewith or subsequently incorporated by reference.</li><li>Shipper agrees to compensate Carrier for the services provided, at the rates and additional charges stipulated in Shipper's load confirmation sheet or any other mutually signed document.</li><li>Carrier is required to furnish proof of delivery along with invoices to Shipper.</li><li>Payment is due within thirty (30) days from the date of receipt.</li><li>Carrier assures Shipper of compliance with the following criteria:</li><li class=\"ql-indent-1\">Carrier is required to uphold cargo insurance covering all risks, with a minimum coverage of $000.00 per shipment.</li><li class=\"ql-indent-1\">Carrier must maintain public liability insurance with a minimum coverage of $000.00, in accordance with federal regulation (If any need to add).</li><li class=\"ql-indent-1\">Carrier is obligated to uphold workers' compensation insurance as mandated by state law.</li><li class=\"ql-indent-1\">Carrier shall provide transportation services for the shipment of Cargo as requested by Shipper, in accordance with the terms and conditions of this Agreement.</li><li class=\"ql-indent-1\">Carrier must uphold satisfactory U.S. DOT safety ratings and possess the necessary authorization to offer the proposed services</li></ol><h3>Rules and Regulations</h3><p>Following Rules shall be applied i.e.</p><p><strong>Performance Standards:</strong></p><ul><li>Outlining the standards and expectations for the transportation services to be provided by the carrier, including i.e.</li><li class=\"ql-indent-1\">Pickup</li><li class=\"ql-indent-1\">Delivery times</li><li class=\"ql-indent-1\">Transit times</li><li class=\"ql-indent-1\">Handling procedures</li></ul><p><strong>Liability and Insurance</strong></p><ul><li>Carrier shall maintain cargo insurance and will be liable for loss, damage, or delay of Cargo occurring during transportation, except to the extent caused by factors beyond Carrier's control or as otherwise provided herein.</li></ul><p><strong>Payment Rates and Charges:</strong></p><ul><li>Shipper will be required to sign a credit application and provide all relevant requested documentation.</li><li>Truckpedia would not be paid in the shipment process since it is a facilitator platform. Shipper would pay to carrier directly.</li><li>The Shipper undertakes to pay the Invoice amount in full and without any deductions within thirty (30) days from the date of the Invoice.</li><li>Any applicable law or regulation will be charged to the Shipper at the prevailing rate and will be paid by the Shipper to the Carrier\u2019s Fee in accordance with the payment in this Agreement.</li><li>Each Party shall be solely responsible for their own taxes including payment and own filing obligations in accordance with the local Laws related to the income, without any liability to the other Party.</li><li>Shipper will be responsible for payment of any custom duties applicable on the shipments (\u201CCustom Duties\u201D), and VAT applicable on cost of Goods.</li><li>Cancelation fees and extra charges may be applicable as per the Carrier\u2019s User Agreement which may be invoiced separately to the Shipper.</li></ul><p><strong>Carrier Qualifications:</strong></p><ul><li>Stipulating the carrier's qualifications, including licensing, permits, insurance requirements, safety ratings, and compliance with applicable laws and regulations.</li></ul><p><strong>Support &amp; Maintenance Services</strong></p><ul><li>The condition and maintenance requirements of the carrier's equipment used for transportation, including vehicles, trailers, and any specialized equipment.</li></ul><p><strong>Dispute Resolution</strong></p><ul><li>Providing procedures for resolving disputes that may arise under the agreement, including mediation, arbitration, or litigation processes.</li></ul><p><strong>Terms and Termination</strong></p><ul><li>The contractual relationship between the Shipper and Carrier formed by this Agreement shall be effective from the time of the Shipper\u2019s acceptance.</li><li>The Outlining the circumstances under which either party may terminate the agreement upon thirty (30) days' notice.</li><li>Termination of the contractual relationship between the Shipper and Carrier for whatever reason and in whatever form shall be without prejudice to the parties ongoing obligations in accordance with their respective terms and conditions.</li></ul><p><strong>Restrictions</strong></p><p>Truckpedia encourages Shipper for warrants, and undertakes to fully perform and observe its obligations in this Agreement as follows:</p><p>Permission for Modification</p><ol><li> Modifying, translating, or creating derivative works based on the service or software, except as explicitly permitted.</li></ol><p>Remove Proprietary Notices</p><ol><li>Removing any proprietary notices or labels associated with the service or software.</li></ol><p>Authority</p><ol><li>The Shipper has the power and authority to accept this Agreement and to exercise its rights and perform its obligations under this Agreement</li></ol><p>License and Insurance</p><ol><li>The Shipper is lawfully authorized to conduct business in the Territory.</li><li>The Shipper carries all licenses, insurances, permits, certificates and approvals that are necessary for the Goods it wishes to transport by using the Transportation Services, by the relevant authorities of the Territory.</li><li>Upon Truckpedia\u2019s request, the Shipper agrees to provide a copy of any insurances and documents related thereto.</li></ol><p>Illegal Activity.</p><ol><li>The Shipper warrants that it shall not be involved in any illegal, restricted activity or engage in any illicit practice such as but not limited to smuggling or trafficking.</li></ol><p>Conditions of Goods.</p><ol><li>The Shipper warrants that all Goods that it wishes to be transported by using the Transportation Services are legal, authorized, safe and insured. The Shipper further agrees that it shall not engage in the use of Restricted Material.</li></ol><p><br></p><p><strong>GENERAL PROVISIONS</strong></p><p>Confidentiality</p><ul><li>Each party (the \u201CReceiving Party\u201D) understands that the other party (the \u201CDisclosing Party\u201D) has disclosed or may disclose business, technical or financial information relating to the Disclosing Party's business (hereinafter referred to as \u201CProprietary Information\u201D of the Disclosing Party).</li><li>If the Receiving Party is compelled by law to disclose Proprietary Information of the Disclosing Party, it shall, to the extent legally permissible, provide the Disclosing Party with prior notice of such compelled disclosure and reasonable assistance, at Disclosing Party's cost, if the Disclosing Party wishes to contest the disclosure.</li></ul><p>Intellectual Property Rights.</p><ul><li>All intellectual property rights such as trademarks, patents and copyrights, including any branding are and shall remain the sole property of the owner thereof and the other Party shall acquire no right or interest in such property or any right to use it without the owner\u2019s prior written consent.</li></ul><p>Force Majeure</p><ul><li>In no event shall Truckpedia be responsible or liable for any failure or delay in relation to its services, resulting from unusual and unforeseeable events beyond its reasonable control, including, without limitation, acts of God, natural disasters, pandemics, terrorist acts, shortage of supply, unforeseeable breakdowns or malfunctions of the technical or digital system, power failures, war or civil unrest.</li><li>Neither party will be deemed to be in breach of this Agreement for any failure or delay in performance caused by reasons beyond its reasonable control. However, this does not apply to payment obligations under this Agreement.</li></ul><p>Subcontracting</p><ul><li>The Carrier may not sub-contract all or part of the Transportation Services without the Shipper\u2019s prior consent.</li><li>If sub-contracted, the Carrier shall accept complete responsibility for the acts or omissions of its licensed subcontractors that it hired or contracts with to perform or assist in the performance of the Transportation Services just as the Carrier is responsible for its own acts and omissions.</li></ul><p>Exclusivity</p><ul><li>Nothing herein shall confer any exclusivity upon the Shipper with respect to the contractual relationship between Truckpedia and you.</li></ul><p>Governing Law and Dispute Resolution</p><ul><li>Any dispute arising out of the formation, performance, interpretation, nullification, termination, or invalidation of this Agreement, arising therefrom, or related thereto in any manner whatsoever, the parties agree to submit to the personal jurisdiction of the aforementioned court.</li></ul><p><br></p><p><br></p><ul><li>Modifications to this Agreement must be in writing and signed by both parties, except as otherwise provided herein. A waiver of any breach in one instance is not a waiver of any subsequent breach.</li><li>Independent Contractors</li><li>The Agreement establishes the parties as independent contractors, with no agency, partnership, joint venture, or employment relationship formed between them.</li></ul><p><strong><u>Notices</u></strong></p><p><br></p><ul><li>Notices under this Agreement must be in writing and will be deemed given when received by the appropriate method of delivery.</li></ul><p><br></p><p><strong><u>Publicity</u></strong></p><p>The parties can issue a press release about the Agreement, and the Customer may serve as a reference account upon mutual agreement.</p><p><br></p><p><br></p><p>However, specific terms of the Agreement cannot be disclosed except when mandated by law. Counterparts; Electronic Signature</p><p>The Agreement can be signed electronically or in multiple copies, with the same legal validity as a manual signature.</p><h2><br></h2><h2><strong>Updates to Terms &amp; Conditions</strong></h2><p>Truckpedia reserves the right to propose changes to the Agreement terms, providing at least thirty (30) days' notice for material changes. Customer's continued use of the Services after revisions become effective indicates agreement to be bound by the revised terms. If Customer does not agree to the new terms, they are no longer authorized to use the Services. In the event of a material change, Customer may terminate the Agreement within thirty (30) days of notice and receive a refund of any pre-paid fees applicable to the period after termination.</p><p>This Agreement shall be binding upon and insure to the benefit of the Parties hereto and their respective heirs, personal representatives, successors, and assigns. Any amendments or modifications to this Agreement must be in writing and signed by both Parties.</p><p><br></p><p><br></p><p><br></p><p>CARRIER:_______________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;SHIPPER:_________________________</p>";

